import React, { Component } from 'react'
import { TextField } from '@material-ui/core';
export default class TextFieldComponent extends Component {
    changeText = (text, data) => {
        data.value = text;
        this.props.changeText(data)
    }
    render() {
        let { data } = this.state;
        return (
            <TextField style={{ width: '100%', backgroundColor: this.props.published ? "#FFE4C470" : "white" }} onChange={(text) => this._changeText(text, data)} />
        )
    }
}
